(1, 'Кейс №1. Повышение ценности приема врача для пациента', '<h4>Контекст</h4><p>Норма времени на прием врачей первого уровня (педиатра, терапевта, хирурга) составляет 12 минут, врачей второго уровня – 15 минут. Расчетное время на оформление врачом медицинской документации должно составлять менее 35% от времени, отведенного на прием. Таким образом, времени на прием терапевта и педиатра остается 8-9 минут.</p><h4>Ключевой вопрос</h4><p>В государственной системе здравоохранения города Москвы ведется работа по развитию пациентоориентированной культуры, при этом ряд пациентов отмечает «формальный» подход врачей и связывает его с крайне ограниченным временем приема. Часть времени, отведенного на пациента, затрачивается на заполнение медицинской документации. В случае, если врачу потребуется больше времени на оказание помощи, возможно увеличение времени ожидания других пациентов.</p><p>Какие пути решения данной задачи вы можете предложить? Ваш ответ может предполагать, в том числе, внесение изменений в действующие нормативные правовые и законодательные акты.</p>', '20', NULL, 'brief-one', '50bbbddd-c5a3-4011-b322-d45b30dccbbe', '2024-04-27 15:43:50', '2024-04-27 15:43:50'),
(2, 'Кейс №2. Развитие корпоративной культуры организации', '<h4>Контекст</h4><p>По данным исследования Harvard Business Review организации с развитой корпоративной культурой на 20-30% эффективнее аналогичных, не имеющих корпоративной культуры. В таких организациях сотрудники вовлечены в собственное развитие и совершенствование процессов организации, разделяя общие ценности, правила и ожидания.</p><p>В системе здравоохранения в отдельных подразделениях и организациях наблюдается текучка кадров.</p><h4>Ключевой вопрос</h4><p>Сотрудники, приходящие в организации, нуждаются в системе адаптации и поддержки, наличии программ для поддержания благополучия (вовлеченности, самочувствия, мотивации). Если такой запрос сотрудников не удовлетворяется организацией, они могут поменять место работы.</p><p>Предложите стратегию развития корпоративной культуры в вашей организации.</p>', '20', NULL, 'brief-two', '62e88036-08c2-4317-8510-3cc9fccdde7a', '2024-04-27 15:43:50', '2024-04-27 15:43:50'),
(3, 'Кейс №3. Регулирование вопроса отмены приема по инициативе пациента', '<h4>Контекст</h4><p>Обеспечение высокой доступности медицинской помощи – одно из приоритетных направлений деятельности системы здравоохранения. Сроки ожидания приема врача-специалиста в поликлинике в среднем составляют не более 7 дней, сроки ожидания плановой госпитализации по основным медицинским профилям – не более 14 дней. Однако при формировании сетки приема врачей никак не регулируется вопрос отмены приема и неявки по инициативе пациента.</p><h4>Ключевой вопрос</h4><p>Несмотря на все принимаемые меры, доступность медицинской помощи не всегда достигает целевых значений. Пациенты отменяют/переносят прием или не являются на него без уведомления медицинской организации, что приводит к затруднению получения медицинской помощи другими пациентами и нерациональному расходованию ресурса медицинской организации.</p><p>Предложите решение данной ситуации, в том числе с возможным вовлечением в нее пациентского сообщества. Ваш ответ может предполагать внесение изменений в действующие нормативные правовые и законодательные акты.</p>', '20', NULL, 'brief-three', 'f829f443-337e-4c02-b835-d625c6933882', '2024-04-27 15:43:50', '2024-04-27 15:43:50'),
(4, 'Кейс №4. Управление парком медицинского оборудования', '<h4>Контекст</h4><p>Создание и использование инструментов принятия решений и автоматизации процессов в части эксплуатации медицинского оборудования.</p><p>Существует система для учета данных по медицинскому оборудованию (УМО ЕМИАС), в ней присутствуют информация:</p><ul><li>параметры оборудования (вид, модель, производитель, год выпуска и т.д.)</li><li>месторасположение (адрес, кабинет, отделение и т.д.)</li><li>информация о ремонте и техническом обслуживании (дата инцидента, статус, срок ремонта и т.д.)</li></ul><p>На основе этих данных создано несколько отчетов и дашбордов: статистика ремонтов оборудования, состояние парка медицинской техники, продолжительность и причины простоя, динамика использования оборудования, карта доступности и загруженности медицинской техники и т.д.</p><h4>Ключевой вопрос</h4><p>Созданы инструменты для мониторинга ключевых параметров эксплуатации оборудования, для анализа показателей и принятия управленческих решений.</p><p>При этом, согласно статистики активности пользователей, не все медицинские организации используют созданные инструменты и не занимаются активным управлением парком техники.</p><p>Предложите варианты решения следующих вопросов:</p><p>Как побудить/ мотивировать медицинские организации активно и системно использовать уже готовые инструменты для эффективного управления парком?</p><p>Какие дополнительные инструменты нужны к уже имеющемуся функционалу?</p><p>Какой функционал и инструменты нужны медицинскому персоналу для помощи в его работе в части эксплуатации медицинского оборудования?</p>', '20', NULL, 'brief-four', '3b7f237a-00c5-4089-9ed2-bae949aadc16', '2024-04-27 15:43:50', '2024-04-27 15:43:50'),
(5, 'Кейс №5. Повышение эффективности передачи информации о состоянии оборудования', '<h4>Контекст</h4><p>На текущий момент при возникновении неисправности оборудования существуют несколько проблем при передаче информации от медицинского персонала инженеру МО:</p><ul><li>информация передается по разным каналам коммуникации (устно, по телефону, в чатах и т.д.);</li><li>информация передается несвоевременно;</li><li>информация не передается;</li><li>информация передается, но не фиксируется, следовательно инженер МО может ее не передать исполнителю по контракту;</li><li>информация передается по другому оборудованию;</li><li>информация не соответствует действительности (ложные вызовы).</li></ul><h4>Ключевой вопрос</h4><p>Предложите возможные решения для передачи информации о неисправности медицинского оборудования, которые будут обеспечивать актуальность, достоверность и своевременность представления информации</p>', '20', NULL, 'brief-five', 'eec00a50-d616-4c94-97de-4999c8c778cd', '2024-04-27 15:43:50', '2024-04-27 15:43:50'),
(6, 'Кейс №6. Развитие системы адаптации и наставничества ', '<h4>Контекст</h4><p>С 2018 года в рамках приказа Департамента здравоохранения г. Москвы от 29 декабря 2017 № 955 «Об утверждении Положения об адаптации медицинских работников в медицинских организациях государственной системы здравоохранения города Москвы» определена система адаптации и наставничества в целях уменьшения текучести кадров, формирования кадрового резерва и создания климата преемственности, поддержки и вовлеченности молодых специалистов в организационную культуру медицинской организации, укрепления профессионального коллектива внутри каждой медицинской организации.</p><h4>Ключевой вопрос</h4><p>На данный момент в медицинских организациях используются разные подходы к реализации модели адаптации и наставничества. Предложите пути развития системы адаптации и наставничества сотрудников в сети Департамента, сохраняющие действующие практики организаций и предполагающие систему мотивации организаций, команд авторов и внедренцев этих практик, а также наличие прозрачного инструмента оценки хода внедрения системы адаптации и наставничества на уровне Департамента. В рамках решения задачи вы можете предлагать внесение изменений в действующие нормативные правовые и законодательные акты.</p>', '20', NULL, 'brief-six', '58ea8981-6b72-42c7-a66d-a87703389827', '2024-04-27 15:43:50', '2024-04-27 15:43:50'),
(7, 'Кейс №7. Формирование механизма привлечения и адаптации врачей-стажеров', '<h4>Контекст</h4><p>Приказом Министерства здравоохранения Российской Федерации от 25 декабря 2024 года № 716н «Об утверждении профессионального стандарта «Менеджер по информационным технологиям» утвержден порядок и условия допуска лиц, обучающихся по программам ординатуры по одной из специальностей укрупненной группы специальностей «Клиническая медицина», к осуществлению медицинской деятельности на должности врачей-стажеров.</p><h4>Ключевой вопрос</h4><p>Механизм привлечения врачей-стажеров в полной мере не внедрен в медицинских организациях Департамента здравоохранения города Москвы. Вместе с тем в медицинских организациях сохраняется высокая потребность во врачах отдельных специальностей. Предложите решение, направленные на привлечение \"молодых\" специалистов на должности врачей-стажеров в медицинских организациях (в т.ч. по наиболее востребованным специальностям) и их адаптацию на рабочем месте.</p>', '20', NULL, 'brief-seven', '790ab3b6-3e69-4d1c-ba28-454c9ff8d729', '2024-04-27 15:43:50', '2024-04-27 15:43:50'),
(8, 'Кейс №8. Снижение влияния дефектных рентгеновских изображений на качество медицинской помощи', '<h4>Контекст</h4><p>Проведение рентгенологических исследований часто сопровождается получением неоптимальных, дефектных изображений с нарушенными критериями качества. Такие изображения являются малоинформативными и имеют сниженную диагностическую ценность, что может приводить к гипо- и гипердиагностике различных патологических состояний пациента. Существуют диагностические сервисы искусственного интеллекта, применяемые для описания исследований, но они также сильно теряют в качестве данных при анализе дефектных изображений, а также от неверно заполненной метаинформации об исследовании.</p><h4>Ключевой вопрос</h4><p>Наличие дефектных исследований затрудняет работу врача рентгенолога и снижает качество оказываемой медицинской помощи. Предложите решение текущей проблемы, в том числе, возможно, с применением искусственного интеллекта.</p>', '20', NULL, 'brief-eight', '2c908e4c-122c-4ffb-ae7e-f3aaae1d4bb3', '2024-04-27 15:43:50', '2024-04-27 15:43:50'),
(9, 'Кейс №9. Повышение престижа медицинской профессии среди молодежи', '<h4>Контекст</h4><p>29 февраля 2024 года Президент РФ, выступая с Посланием Федеральному Собранию, анонсировал запуск нового национального проекта «Кадры». «Нам важно, чтобы эти ребята, сегодняшние подростки, стали профессионалами своего дела, готовыми трудиться в экономике 21-го века. На это направим новый национальный проект «Кадры», – заявил Владимир Путин.</p><p>Проблема дефицита специалистов, в том числе по ряду медицинских специальностей, является актуальной как для всей страны в целом, так и для Москвы в частности. Так, согласно данным портала HH.RU, среди изученных в январе-феврале 2023 г. 60 врачебных специальностей в 43 случаях число вакансий превышало количество резюме. Оказалось, что на одну вакансию в сфере «медицина, фармацевтика» в стране приходится всего 1,1 резюме, а на одну вакансию врача – 0,6 резюме.</p><h4>Ключевой вопрос</h4><p>Повышение престижа медицинских специальностей, информирование и привлечение внимания молодёжи к врачебной деятельности является важным элементом преодоления дефицита кадров.</p><p>Предложите проработанный комплекс мероприятий, направленный на повышение осведомленности молодёжи о профессиональной деятельности врачей, который позволил бы просветить и вдохновить молодежь на выбор медицинской профессии, а также привлечь внимание к научной деятельности в медицине с применением искусственного интеллекта.</p><p>Целевая аудитория: обучающиеся 9 – 11 классов и студенты колледжей и вузов.</p>', '20', NULL, 'brief-nine', 'e88c7466-4aaa-4b13-a063-cf21e5a70a1d', '2024-04-27 15:43:50', '2024-04-27 15:43:50'),
(10, 'Кейс №10. Информированность и маршрутизация пациентов ', '<h4>Контекст</h4><p>В структуре Департамента здравоохранения города Москвы представлены более 200 медицинских организаций различных уровней и профилей медицинской помощи, в том числе многопрофильные лечебные учреждения. Пациенты имеют возможность обратиться за плановой медицинской помощью в поликлинику по месту прикрепления, могут быть направлены в другие учреждения, а также получить медицинскую помощь в экстренной и неотложной формах. Однако пациенты не всегда достаточно информированы о возможностях получения медицинской помощи в медицинских организациях.</p><h4>Ключевой вопрос</h4><p>Предложите решение, которое поможет пациентам столичного здравоохранения ориентироваться в возможностях получения медицинской помощи, а медицинским работникам - улучшить маршрутизацию пациентов внутри и между медицинскими организациями Департамента.</p>', '20', NULL, 'brief-ten', '78d074d5-76d5-4e65-b713-dfb12f40bde7', '2024-04-27 15:43:50', '2024-04-27 15:43:50');
