(17, 1, 'При планировании проекта командой были выделены все взаимосвязи между работами, на основании чего был определен порядок их выполнения для наибольшей эффективности и избежания простоев. Такой метод планирования получил название:', 1, 1, NULL, '62d87855-209e-4d07-a4f2-bafdef2d9ad8', NULL, '2024-05-06 06:54:29', '2024-05-06 06:54:29'),
(18, 1, 'В ходе реализации проекта стала очевидна необходимость внесения ряда изменений в план-график. Первичная оценка на основании диаграммы Ганта дала понять, что данные изменения повлияют на сроки реализации проекта, и поэтому они точно требуют согласования, как с руководителем проекта, так и с его куратором. Какая методология управления на ваш взгляд наиболее вероятно используется в рамках данного проекта:', 1, 1, NULL, '8b142682-2568-45ca-a93c-9934505ed1ef', NULL, '2024-05-06 06:54:29', '2024-05-06 06:54:29'),
(19, 1, 'Детальное планирование всех функциональных областей проекта проводится на этапе:', 1, 1, NULL, '5b21573e-12b6-44ab-9036-ab185921835c', NULL, '2024-05-06 06:54:29', '2024-05-06 06:54:29'),
