INSERT INTO `teams_projects_ideas_themes` (`id`, `name`, `description`, `slug`, `created_at`, `updated_at`) VALUES
(1, 'Культура работы с персоналом', '<p>Проекты, направленные на развитие ценностей, норм и практик, которые определяют особенности взаимодействия внутри организации и влияют на благополучие, удовлетворенность работой, мотивацию и продуктивность сотрудников</p>', '31b13173-adb1-4cd7-8b44-84d93ee04c35', '2024-04-10 13:50:52', '2024-04-10 13:50:52'),
(2, 'Культура работы с пациентами', '<p>Проекты, направленные на создание безопасной, отзывчивой и дружелюбной среды, где пациенты чувствуют себя уважаемыми, информированными и участвующими в принятии решений относительно своего лечения</p>', 'c9242212-730a-46e9-918e-377442176b38', '2024-04-10 13:50:52', '2024-04-10 13:50:52'),
(3, 'Культура работы с данными', '<p>Проекты, направленные на установление принципов и практик, которые регулируют сбор, хранение, обработку и анализ данных. Инциативы могут включать в себя аспекты защиты данных, конфиденциальности, точности, доступности и интерпретируемости</p>', 'fcc126fd-182a-4046-8758-4294841bf0a3', '2024-04-10 13:50:52', '2024-04-10 13:50:52'),
(4, 'Культура цифровизации', '<p>Проекты, направленные на интеграцию цифровых технологий во все аспекты деятельности организации. Инициативы направлены не только на внедрение технологических инструментов, но и преобразование внутренних процессов, корпоративной культуры и моделей взаимодействия с пациентами</p>', '0dc93bdc-926d-4c3b-a80b-a1cd0edd0ebe', '2024-04-10 13:50:52', '2024-04-10 13:50:52');
